import './App.css';


const api = {
  key: "0f4e92f2963938871eb6ec83654a8366",
  base: "https://api.openweathermap.org/data/2.5"
}



function App() {


  return (
    <div className="App">
      <main>
        <div className="search-box">
          <input 
          type="text"
          className="search-bar"
          placeholder="Search..."/>
        </div>

        <div className="location-box">
          <div className="location">
            Navegantes, SC
          </div>

        </div>
      </main>

    </div>
  );
}

export default App;
